def get_test_block(file_name, block_index):
    """
    Get a specific course block for testing.
    
    Args:
        file_name: Name of the test file (e.g., 'MATH_WIN_2023')
        block_index: Index of the block to return (0-based)
        
    Returns:
        str: HTML course block
    """
    blocks = TEST_BLOCKS.get(file_name, [])
    if block_index >= len(blocks):
        raise IndexError(f"Block index {block_index} out of range for {file_name} (has {len(blocks)} blocks)")
    return blocks[block_index]

def get_all_blocks(file_name):
    """
    Get all course blocks for a test file.
    
    Args:
        file_name: Name of the test file
        
    Returns:
        List[str]: All course blocks for the file
    """
    return TEST_BLOCKS.get(file_name, [])

def get_block_count(file_name):
    """
    Get the number of course blocks for a test file.
    
    Args:
        file_name: Name of the test file
        
    Returns:
        int: Number of course blocks
    """
    return len(TEST_BLOCKS.get(file_name, []))

